import React, { useState } from 'react';
import './App.scss';
import { ArticlesList, Footer, Header } from './components';

const App: React.FC<unknown> = () => {
  const [isShownContent, setIsShownContent] = useState(false);

  React.useEffect(() => {
    setTimeout(() => {
      setIsShownContent(true);
    }, 5000);
    return () => {
      setIsShownContent(false);
    };
  }, []);

  return (
    <div className="max-w-[1280px] mx-auto container">
      <Header />
      <div className="container content-wrapper">
        <ArticlesList />
        <Footer />
      </div>
    </div>
  );
};

export default App;
